(141, 'theme_mods_wp-simple', 'a:50:{i:0;b:0;s:18:\"nav_menu_locations\";a:0:{}s:18:\"custom_css_post_id\";i:-1;s:16:\"fp-banner-toggle\";s:1:\"1\";s:15:\"fp-banner-title\";s:11:\"Väike-Jõe\";s:21:\"fp-banner-button-text\";s:19:\"Kontrolli saadavust\";s:20:\"fp-banner-button-url\";s:35:\"http://www.booking.com/Share-lF6ePq\";s:19:\"fp-banner-sub-title\";s:17:\"Holiday Apartment\";s:16:\"fp-social-toggle\";s:1:\"1\";s:14:\"fp-team-toggle\";s:1:\"1\";s:13:\"fp-test-title\";s:12:\"Natuke meist\";s:19:\"fp-test-description\";s:410:\"Väike-Jõe Holiday Apartment paikneb rahulikus ja looduskaunis piirkonnas Pärnu jõe ääres, kõigest 5 min jalutuskäigu kaugusel linna keskusest.\n\nMeie hubane ja kõigi mugavustega korter on külaliste seas kõrgelt lugupeetud oma suurepärase asukoha ja soodsa hinna tõttu.\n\nKui plaanid oma puhkuse Pärnus veeta, siis Väike-Jõe Holiday Apartment on ideaalne peatumiskoht just sulle ja su kaaslastele.\";s:14:\"fp-test-toggle\";s:1:\"1\";s:11:\"fp-test-tag\";s:0:\"\";s:15:\"fp-test-tag-url\";s:0:\"\";s:13:\"fp-test-image\";s:57:\"http://localhost/wp-content/uploads/2019/03/152745989.jpg\";s:26:\"fp-banner-background-image\";s:53:\"http://localhost/wp-content/uploads/2019/03/room2.png\";s:14:\"contact-toggle\";s:1:\"1\";s:27:\"fp-contact-background-image\";s:53:\"http://localhost/wp-content/uploads/2019/03/roses.png\";s:16:\"fp-contact-title\";s:22:\"Võta meiega ühendust\";s:17:\"fp-action2-toggle\";s:1:\"1\";s:27:\"fp-action2-background-image\";s:52:\"http://localhost/wp-content/uploads/2019/03/wall.png\";s:16:\"fp-action2-title\";s:15:\"Broneeri nüüd\";s:22:\"fp-action2-button-text\";s:4:\"Mine\";s:21:\"fp-action2-button-url\";s:35:\"http://www.booking.com/Share-lF6ePq\";s:27:\"fp-action1-background-image\";s:53:\"http://localhost/wp-content/uploads/2019/03/wall2.png\";s:16:\"fp-action1-title\";s:15:\"Kinnita majutus\";s:20:\"fp-action1-sub-title\";s:57:\"Vali endale sobivad kuupäevad ja alusta oma puhkust siit\";s:22:\"fp-action1-button-text\";s:16:\"Edasi broneerima\";s:17:\"fp-action1-toggle\";s:1:\"1\";s:21:\"fp-action1-button-url\";s:35:\"http://www.booking.com/Share-lF6ePq\";s:14:\"fp-news-toggle\";s:1:\"1\";s:13:\"fp-news-title\";s:12:\"Natuke meist\";s:17:\"fp-news-sub-title\";s:408:\"Väike-Jõe Holiday Apartment paikneb rahulikus ja looduskaunis piirkonnas Pärnu jõe ääres, kõigest 5 min jalutuskäigu kaugusel linna keskusest. Meie hubane ja kõigi mugavustega korter on külaliste seas kõrgelt lugupeetud oma suurepärase asukoha ja soodsa hinna tõttu. Kui plaanid oma puhkuse Pärnus veeta, siis Väike-Jõe Holiday Apartment on ideaalne peatumiskoht just sulle ja su kaaslastele.\";s:18:\"fp-featured-toggle\";s:1:\"1\";s:15:\"fp-about-toggle\";s:1:\"1\";s:14:\"fp-about-title\";s:10:\"Ülevaade \";s:20:\"fp-about-description\";s:0:\"\";s:18:\"fp-about-sub-title\";s:72:\"Meie korteris on saadaval kõik vajalik, mida mugavaks puhkuseks tarvis:\";s:13:\"fp-team-title\";s:17:\"Ruumide ülevaade\";s:17:\"fp-team-sub-title\";s:38:\"Kliki piltidel, et suunduda galeriisse\";s:26:\"fp-social-background-image\";s:59:\"http://localhost/wp-content/uploads/2019/03/white_roses.png\";s:15:\"fp-social-title\";s:15:\"Leia meid üles\";s:19:\"fp-social-sub-title\";s:82:\"Oleme kättesaadavad ka järgmiste kanalite kaudu. Külasta kindlasti neid kõiki!\";s:22:\"nimbus_center_featured\";s:2:\"34\";s:17:\"fp-featured-title\";s:13:\"Meie lemmikud\";s:20:\"fp-contact-sub-title\";s:39:\"Küsimuste korral kirjuta meile julgelt\";s:20:\"fp-action2-sub-title\";s:73:\"Reserveeri külaliste poolt armastatud Väike-Jõe Holiday apartment siit\";s:14:\"contact-mailto\";s:16:\"info@vaikejoe.ee\";s:16:\"contact-mailfrom\";s:15:\"web@vaikejoe.ee\";}', 'yes'),
